# Counts for the number of active projects
def num_of_active_projects(projects, borough_code)
  count = 0
  projects["data"].each do |school_arr|
    if school_arr[9] == borough_code
      count += 1
    end
  end
  count
end

# Takes in a code from the user and passes it through the previous method, then puts the count
def run(projects)
  puts "Please enter a borough code to see the number of active construction projects on schools in that borough."
  user_borough_code = gets.chomp.upcase
  project_count = num_of_active_projects(projects, user_borough_code)
  puts "There are #{project_count} active projects."
end

run(active_projects)